import React from 'react';
import { MDBBtn, MDBContainer } from 'mdb-react-ui-kit';
import Logo from '../Media/proximo.png';
import {
    MDBInputGroup,
    MDBInputGroupText,
    MDBInputGroupElement
  } from 'mdb-react-ui-kit';


const Landing = () => {
    return (
        <MDBContainer className="border border-primary mt-5">
            <div className="row">
                <div className="col border border-secondary">
                    hi
                </div>
                <div className="col border border-secondary">
                    <div className="text-end">
                        <img src={Logo} width="28" alt=""/>
                    </div>
                    <h2 className="fw-bold text-center pt-5">Bienvenido colega</h2>
                    <MDBInputGroup className="p-5 border border-dark shadow-4">
                        <label htmlFor='' className='form-label'>
                         Your vanity URL
                        </label>
                        <MDBInputGroupElement id='' type='text' placeholder='Username' />
                    </MDBInputGroup>
                </div>
            </div>
        </MDBContainer>
    );
}

export {Landing};
